import styles from './Navbar.module.scss';

const Nav = () => {
  return (
    <div className={`row ${styles.topnav}`}>
      <a className={` col-4 ${styles.active}`} href="#home">
        Logo
      </a>
      <div>Search</div>
      <div className="col-6">
        <a href="#news" className="col-3">
          News
        </a>
        <a href="#contact" className="col-3">
          Contact
        </a>
      </div>
    </div>
  );
};

export default Nav;
